import StatisticLine from "./StatisticLine"

const Statistics = ({ goodVote, badVote, neutralVote, clickHistory }) => {
    if (clickHistory.length === 0) {
        return (<>
            <p>No feedback given.</p>
        </>
        )
    } else {
        return (
            <>
                <StatisticLine text="Good" value={goodVote} />
                <StatisticLine text="Neutral" value={neutralVote} />
                <StatisticLine text="Bad" value={badVote} />
                <StatisticLine text="All" value={clickHistory.length} />
                <StatisticLine text="Average" value={(goodVote - badVote) / clickHistory.length} />
                <StatisticLine text="Percentage" value={goodVote / clickHistory.length * 100 + '%'} />
            </>
        )
    }
}


export default Statistics
